import React from 'react';
import styled from 'styled-components';

function SupersetChart() {
    const embedUrl = "https://f8f472ba.us2a.app.preset.io/superset/dashboard/p/e4nkrqVw9j0/";

    return (
        <ChartContainer>
            <iframe
                src={embedUrl}
                title="Superset Chart"
                width="100%"
                height="500px"
                frameBorder="0"
                allowFullScreen
            ></iframe>
        </ChartContainer>
    );
}

const ChartContainer = styled.div`
    background: #fff;
    border: 1px solid #ddd;
    border-radius: 10px;
    overflow: hidden;
    box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
    iframe {
        display: block;
    }
`;

export default SupersetChart;
